__NUXT_JSONP__("/drugs/Dostarlimab", (function(a,b,c,d,e){return {data:[{drug:{slug:a,emaEpar:[{activeSubstance:c,conditionIndication:"Jemparli is indicated as monotherapy for the treatment of adult patients with mismatch repair deficient (dMMR)\u002Fmicrosatellite instability-high (MSI H) recurrent or advanced endometrial cancer (EC) that has progressed on or following prior treatment with a platinum-containing regimen.",inn:c,marketingAuthorisationDate:"2021-04-21 00:00:00",marketingAuthorisationHolder:"GlaxoSmithKline (Ireland) Limited",medicineName:b,url:"https:\u002F\u002Fwww.ema.europa.eu\u002Fen\u002Fmedicines\u002Fhuman\u002FEPAR\u002Fjemperli"}],fdaDrugLabel:[{brand:b,indication:"1 INDICATIONS AND USAGE JEMPERLI is indicated for the treatment of adult patients with mismatch repair deficient (dMMR) recurrent or advanced: • endometrial cancer (EC), as determined by an FDA-approved test, that has progressed on or following prior treatment with a platinum-containing regimen, or • solid tumors, as determined by an FDA-approved test, that have progressed on or following prior treatment and who have no satisfactory alternative treatment options [see Dosage and Administration ( 2.1 )] . These indications are approved under accelerated approval based on tumor response rate and durability of response [see Clinical Studies ( 14 )] . Continued approval for these indications may be contingent upon verification and description of clinical benefit in a confirmatory trial(s). JEMPERLI is a programmed death receptor-1 (PD-1)–blocking antibody indicated for the treatment of adult patients with mismatch repair deficient (dMMR) recurrent or advanced: • endometrial cancer, as determined by an FDA-approved test, that has progressed on or following prior treatment with a platinum-containing regimen, or • solid tumors, as determined by an FDA-approved test, that have progressed on or following prior treatment and who have no satisfactory alternative treatment options. ( 1 , 2.1 ) These indications are approved under accelerated approval based on tumor response rate and durability of response. Continued approval for these indications may be contingent upon verification and description of clinical benefit in a confirmatory trial(s). ( 1 )",manufacturer:"GlaxoSmithKline LLC",splSetId:"095eab9f-545a-4f12-bfb7-19477fb901a5"}],id:a,nciThesaurus:{casRegistry:"2022215-59-2",chebiId:d,chemicalFormula:d,definition:"A humanized monoclonal antibody directed against the negative immunoregulatory human cell surface receptor programmed cell death 1 (PD-1; programmed death-1), with potential immune checkpoint inhibitory and antineoplastic activities. Upon administration, dostarlimab binds to and inhibits PD-1 and its downstream signaling pathways. This may restore immune function through the activation of T-cells. PD-1, a transmembrane protein in the Ig superfamily expressed on T-cells, functions as an immune checkpoint protein that negatively regulates T-cell activation and T-cell-mediated immune responses when activated by its ligands programmed cell death receptor ligand 1 (PD-L1) or 2 (PD-L2); it plays an important role in tumor evasion from host immunity.",fdaUniiCode:"P0GVQ9A4S5",identifier:"C126799",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C128037","C129822"],synonyms:["ANB011","DOSTARLIMAB",a,"Dostarlimab-gxly","Immunoglobulin G4, Anti-programmed Cell Death Protein 1 (PDCD1) (Humanized Clone ABT1 Gamma4-chain), Disulfide with Humanized Clone ABT1 Kappa-chain, Dimer",b,"TSR 042","TSR-042","TSR042"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDostarlimab",extension:".json",createdAt:e,updatedAt:e}}],fetch:{},mutations:void 0}}("Dostarlimab","Jemperli","dostarlimab","","2021-10-30T13:30:51.963Z")));